import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Hello World
        </p>
        <p>
          Atividade 1 (Programação orientada a componentes)
        </p>
        <p>
          Juan
        </p>
      </header>
    </div>
  );
}

export default App;
